import './body.css';
import Date from './carte/date';
import Cour from './carte/Cour';
import Navbarl from '../Navbarl';



function body() {
  return (
    <div className="body">
      
      <div>
       <Navbarl />
       </div>
       <div className='boody'>
       <Date />
       <Cours />
       </div>
        

    </div>
  );
}

export default body;
